import React from 'react';
import { ReactComponent as Logos } from "../images/logo/logo.svg";


export const Logo = (props) => {
  //  const logo = "../images/logo/log.svg";
    return (
        <div className="logo">
            <image>
             <source src={`${Logos}`} title="logo" alt="logo"/>
            </image>
        </div>
    );
};
